export default {
  name: 'PackageShopList',
  mixins: [tableMixin],
  bem: {
    bModal: 'modal-package-off-sales'
  },
  serviceInject() {
    return {
      service: ShopListService
    }
  },
  serviceProviders() {
    return [ShopListService]
  },
  rxState() {
    const { list$, loading$ } = this.service
    return {
      list$,
      loading$
    }
  },
  props: {
    id: [String, Number]
  },
  computed: {
    columns
